import React, {Component} from 'react';
import {connect} from 'react-redux';

class App extends Component {
    render() {
        return (
            <div className="App">
                Hello App
            </div>
        );
    }
}

export default connect(
    (state)=>({
        number: state.counter.number
    }),
    (dispatch)=>({
        increment: ()=>dispatch(),
        decrement: ()=>dispatch(),
    })
)(CounterContainer);
